import React, { FunctionComponent } from "react";
import TodoForm from "./form";
import Styles from "./home.styles";

const Home: FunctionComponent = () => (
  <Styles.Container>
    <TodoForm />
    <Styles.Todos>
      <Todo
        title="{tesssssssssssssss}"
        desciption="dkkkkkkkkkkkkkkkkkkkkkkkkk"
      />
    </Styles.Todos>
  </Styles.Container>
);

export default Home;
